-- ----------------------------
--  Table structure for `coupon`
-- ----------------------------
DROP TABLE IF EXISTS `coupon`;
CREATE TABLE `coupon` (
  `pkid` char(32) NOT NULL,
  `usevalue` decimal(10,2) DEFAULT NULL COMMENT '优惠券面值',
  `enddate` int(11) DEFAULT NULL COMMENT '优惠券可以使用的结束日期',
  `userid` char(32) DEFAULT NULL COMMENT '属于哪个用户',
  `orderid` char(32) DEFAULT NULL COMMENT '该优惠券用在了哪张订单上',
  `status` tinyint(4) DEFAULT '1' COMMENT '使用状态（1=已领用 0=未领用 2=流转中 3=已使用）,订单流转过程中状态为不可用',
  `addtime` int(11) DEFAULT NULL COMMENT '获得优惠券的日期',
  `usetime` int(11) DEFAULT NULL COMMENT '使用时间',
  `usergroup` char(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户分组',
  PRIMARY KEY (`pkid`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

