-- ----------------------------
--  Table structure for `orderdetail`
-- ----------------------------
DROP TABLE IF EXISTS `orderdetail`;
CREATE TABLE `orderdetail` (
  `pkid` char(64) DEFAULT NULL COMMENT '主键',
  `orderid` char(64) DEFAULT NULL COMMENT '订单ID',
  `productid` char(64) DEFAULT NULL COMMENT '订单ID',
  `productcount` int(6) DEFAULT NULL COMMENT '商品数量',
  `productprice` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `productname` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '产品名称',
  `imgpath` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '商品图片'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

-- ----------------------------
--  Table structure for `ordermain`
-- ----------------------------
DROP TABLE IF EXISTS `ordermain`;
CREATE TABLE `ordermain` (
  `pkid` char(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `buyer` char(32) DEFAULT NULL COMMENT '买方ID',
  `buytime` int(12) DEFAULT NULL COMMENT '下单时间',
  `paytime` int(12) DEFAULT NULL COMMENT '付款时间',
  `prerefundtime` int(12) DEFAULT NULL COMMENT '申请退款时间',
  `refundtime` int(12) DEFAULT NULL COMMENT '退款时间',
  `refusetime` int(12) DEFAULT NULL COMMENT '拒绝退款时间',
  `ivtime` int(12) DEFAULT NULL COMMENT '最新操作时间',
  `status` tinyint(1) DEFAULT NULL COMMENT '订单状态：-1：已取消，0：下单,等待派送，1：已派送，2：申请退款，3：拒绝退款，4：同意退款，5：配送中，6:待付款，7:已付款，8:已到达',
  `price` decimal(10,2) DEFAULT NULL COMMENT '订单价格',
  `buycount` int(5) DEFAULT NULL COMMENT '购买数量',
  `buyername` char(128) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '下单人名称',
  `buyermobile` char(128) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '下单人电话',
  `buyeraddress` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '下单人地址',
  `paytype` tinyint(1) DEFAULT '0' COMMENT '付款方式.0.微信支付，1:现金支付',
  `sendtime` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '送气时间',
  `remark` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '留言',
  `refundremark` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '退款理由',
  `refuseremark` char(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '拒绝理由',
  `coupon` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券金额',
  PRIMARY KEY (`pkid`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

